import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import left_bar_menu from "../components/left_bar_menu";


function Dashboard() {

  const root = ReactDOM.createRoot(document.getElementById('root'));
  root.render(
    <React.StrictMode>
      <left_bar_menu />
    </React.StrictMode>
  );

}

export default Dashboard;
